select(2, ...).LoadData("APP_INFO","Global",[[return {version=403,lastSync=1578254439,message={id=0,msg=""},news={{title="TradeSkillMaster v4.9.5 Changelog",content="TSM v4.9.5 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed issue with the number of &#8220;Posts&#8221; displayed from a scan being inflated<br />* [8.3] Fixed issue with the &#8220;Qty&#8221; column in auction tables being inaccurate in some situations<br />* [8.3] Fixed issue with the available purchase quantity being inaccurate in some situations<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1578244028,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-5-changelog/"},{title="TradeSkillMaster v4.9.4 Changelog",content="TSM v4.9.4 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed issue with buying auctions via Sniper<br />* [8.3] Fixed issue with Sniper freezing the game when there are large number of items in groups<br />* [Classic] Fixed issue with vendor search and disenchant search not finding auctions in certain situations<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1578200887,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-4-changelog/"},{title="TradeSkillMaster v4.9.3 Changelog",content="TSM v4.9.3 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed some issues with bidding and buying via Shopping / Sniper<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1578193090,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-3-changelog/"},{title="TradeSkillMaster v4.9.2 Changelog",content="TSM v4.9.2 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed error when bidding on or buying auctions through Sniper<br />* Hiding auctions which can't be bid on from Bid Sniper<br />* Fixed issue causing scanning to be slow in some situations<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1578191784,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-2-changelog/"},{title="Tra